<ng-template #template>
  <div class="modal-header">
    <div class="d-flex justify-content-between align-items-center w-100">
      <h4 id="dialog-sizes-name1" class="modal-title pull-left">
        {{getFacultyDeskName()}}
      </h4>
    </div>
    <button type="button"
            class="btn btn-close" aria-label="Close" (click)="modalRef.hide()">
    </button>
  </div>
  <div class="modal-body" style="max-height: calc(100vh - 210px); overflow-y: auto;">
    <div class="d-flex flex-wrap justify-content-start">
      <app-event-card style="width: 100%" [data]="selectedData" (close)="modalRef.hide()"></app-event-card>
    </div>
  </div>
  <div class="modal-footer button-group justify-content-start" style="padding-left: 20px;">
    <button *ngIf="router.url !== '/index'" type="button" class="btn btn-primary px-1 me-1" [routerLink]="'/index'" (click)="modalRef.hide()">
      Campus térkép
    </button>
    <button *ngIf="router.url !== '/elocsarnok'" type="button" class="btn btn-primary px-1 me-1" [routerLink]="'/elocsarnok'" (click)="modalRef.hide()">
      Előcsarnok
    </button>
    <button *ngIf="router.url !== '/aula'" type="button" class="btn btn-primary px-1 me-1" [routerLink]="'/aula'" (click)="modalRef.hide()">
      Aula
    </button>
    <button *ngIf="router.url !== '/a4'" type="button" class="btn btn-primary px-1 me-1" [routerLink]="'/a4'" (click)="modalRef.hide()">
      A/4
    </button>
  </div>

</ng-template>
